import Contact from "../Contact";
import styles from "./styles.module.css";

const Footer = () => {
  return (
    <footer className={styles.footerContainer}>
      <Contact />
      <iframe
        src="https://1map.com/embed/1158612"
        width="1300"
        height="350"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
        referrerpolicy="no-referrer-when-downgrade"
      ></iframe>
    </footer>
  );
};

export default Footer;
